        public static IPageViewModel? CreatePageViewModelFromEntity(
            this IPageView? entity,
            MappingMode mode,
            string? contextProfileName)
        {
            if (entity == null) { return null; }
            // Map the Inherited Properties
            // ReSharper disable once InvokeAsExtensionMethod
            var model = BaseModelMapper.MapNameableBaseEntityPropertiesToModel(
                RegistryLoaderWrapper.GetInstance<IPageViewModel>(contextProfileName),
                Contract.RequiresNotNull(entity),
                mode,
                contextProfileName);
            // Map this level's Properties
            switch (mode)
            {
                case MappingMode.Full: //////////////////////////////////////////////////////////////////////////////////////////////////////////////
                {
                    // PageView's Properties
                    // PageView's Related Objects
                    model.Address = ModelMapperForAddress.CreateAddressModelFromEntityLite(entity.Address, contextProfileName);
                    model.Campaign = ModelMapperForCampaign.CreateCampaignModelFromEntityLite(entity.Campaign, contextProfileName);
                    model.Category = ModelMapperForCategory.CreateCategoryModelFromEntityLite(entity.Category, contextProfileName);
                    model.Contact = ModelMapperForContact.CreateContactModelFromEntityLite(entity.Contact, contextProfileName);
                    model.IPOrganization = ModelMapperForIPOrganization.CreateIPOrganizationModelFromEntityLite(entity.IPOrganization, contextProfileName);
                    model.Product = ModelMapperForProduct.MapLiteProductOldExt(entity.Product);
                    model.SiteDomain = ModelMapperForSiteDomain.CreateSiteDomainModelFromEntityLite(entity.SiteDomain, contextProfileName);
                    model.User = ModelMapperForUser.CreateUserModelFromEntityLite(entity.User, contextProfileName);
                    model.Visitor = ModelMapperForVisitor.CreateVisitorModelFromEntityLite(entity.Visitor, contextProfileName);
                    // PageView's Associated Objects
                    model.PageViewEvents = (entity is AnonPageView ? ((AnonPageView)entity).PageViewEvents : entity.PageViewEvents)?.Where(x => x.Active).Select(x => ModelMapperForPageViewEvent.CreatePageViewEventModelFromEntityList(x, contextProfileName)).ToList()!;
                    // Additional Mappings
                    if (CreatePageViewModelFromEntityHooksFull != null) { model = CreatePageViewModelFromEntityHooksFull(entity, model, contextProfileName); }
                    goto case MappingMode.Lite;
                }
                case MappingMode.Lite: //////////////////////////////////////////////////////////////////////////////////////////////////////////////
                {
                    // PageView's Properties
                    // IHaveATypeBase Properties (Forced)
                    model.Type = ModelMapperForPageViewType.CreatePageViewTypeModelFromEntityLite(entity.Type, contextProfileName);
